import {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      name: {firstname: 'Alp', lastname:'Inan'},
      company: 'Google',
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hi {this.state.name.firstname} {this.state.name.last}, I work at {this.state.company}
          </p>
          <button onClick={() => {
            this.setState(
              {name:{firstname:'Ceylin', lastname:'Bekin'}});
              console.log(this.state);
          }}> Change Name

          </button>
        </header>
      </div>
    );
  }
}

export default App;
